import React from 'react'
import UnderConstruction from "../assets/UnderConstruction.png"


function Facebook() {
    return (
        <div   style={{
            justifyContent: 'center',
            alignItems: 'center',
          }}>
            <img className="center" src={UnderConstruction}/>
        </div>
    );
}

export default Facebook;
